import React from 'react'
import { SpecialtiesCard } from './SpecialtiesCard'

export const SpecialtiesComponent = () => {
  return (
    <div>
        <SpecialtiesCard title="Cardology" pic="./Images/Icons_Cardiology.png" description="provides reliable medical billing services that helps you improve your practice’s revenue stream. Also, we apply the best billing practices to prevent your practice revenue cycle from any kind of error that can cause claim denials way forward. "/>
        <SpecialtiesCard title="Cardology" pic="./Images/Icons_Cardiology.png" description="provides reliable medical billing services that helps you improve your practice’s revenue stream. Also, we apply the best billing practices to prevent your practice revenue cycle from any kind of error that can cause claim denials way forward. "/>
        <SpecialtiesCard title="Cardology" pic="./Images/Icons_Cardiology.png" description="provides reliable medical billing services that helps you improve your practice’s revenue stream. Also, we apply the best billing practices to prevent your practice revenue cycle from any kind of error that can cause claim denials way forward. "/>
    </div>
  )
}
